title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o9997.m13 -> o9986.m19 -> o9997.m38 -> o9986.m21 -> o9997.m38
  o9986.m37 -> o9997.m38 -> o9986.m21 -> o9997.m38
  o9997.m3 -> o9986.m29 -> o9997.m38 -> o9986.m21 -> o9997.m38
  o9986.m19 -> o9997.m38 -> o9986.m21 -> o9997.m38
  o9986.m21 -> o9997.m38 -> o9986.m21
  o9997.m38 -> o9986.m21 -> o9997.m38
  o9986.m29 -> o9997.m38 -> o9986.m21 -> o9997.m38

features:
  - inheritance
  - overriding
  - method
  - polymorphism

